caption:
Nhờ có sự đón nhận của các bạn mà Uncovered Collection được tiếp tục hành trình lan toả thông điệp không ngừng khám phá bản thân và mở rộng thêm 5 tông màu mới cực đẹp 🤍

Bạn nào chung hệ mê đắm thế giới sắc màu như son thì cũng hiểu rằng không phải cứ thoa đại một màu nào là xong. Nếu đúng tâm trạng, đúng ngày, đúng màu son, đúng outfit, mọi thứ bỗng trở nên hợp lý và tinh thần auto thoải mái liền đúng không? 🥹 Vì vậy, mình và team sẽ luôn cố gắng để mang tới những sắc màu đẩy mood tâm trạng đó tới mọi người 😉

Với lần ra mắt này, mình xin dành tặng giveaway ngẫu nhiên The Unstoppable Set (gồm 5 màu son, 1 túi Luna, 1 túi Irene và 1 cọ môi) cho 3 bạn. Kết quả sẽ được update tại post này vào 19h 9/8 nhé nhé 🫶🏻 Màu nào của Chap 2 là chân ái với bạn?

